SELECT DISTINCT ?Seed WHERE{ 
	?Seed 	 rdf:type 	 <http://dbpedia.org/ontology/MilitaryUnit> .
	?Seed 	 <http://dbpedia.org/ontology/colour> 	 ?count . 
} GROUP BY ?Seed 
 HAVING (COUNT(?count) <= 6)

SELECT DISTINCT ?Seed WHERE{
	 ?Seed 	 rdf:type 	 <http://dbpedia.org/ontology/Nerve> . 
	MINUS{ 
		{?Seed 	 <http://dbpedia.org/ontology/branchFrom> 	 <http://dbpedia.org/resource/Spinal_nerve> .} UNION 
		{?Seed 	 <http://dbpedia.org/ontology/branchTo> 	 <http://dbpedia.org/resource/Dorsal_nerve_of_the_clitoris> .} 
	} 
}

